
class String:

	def __init__(self, string):
		self.string = string
		self.length = len(string)
		self.max_len = 10

	def getSegment(self, seg_begin):
	    seg_end = seg_begin+self.max_len
	    if seg_begin >= self.length:
	        seg_begin -= self.length
	        seg_end -= self.length
	    if seg_end > self.length:
	        seg_end -= self.length
	        return self.string[seg_begin:]+self.string[:seg_end]
	    return self.string[seg_begin:seg_end]

def get_seg(string, seg_begin, seg_length):

	str_length = len(string)
	seg_end = seg_begin + seg_length

	if seg_end > str_length:
		seg_end -= str_length
		return string[seg_begin:]+string[:seg_end]

	return string[seg_begin:seg_end]

def shift(string, move):
        return string[move:]+string[:move]

# B Sieve of Eratosthenes
def sieve_of_eratosthenes(n):
	prime_numbers = []
	dustbin = set()

	for cand in range(2, n+1):

		if cand in dustbin: continue
			
		for dust in range(cand*2, n+1, cand):
			dustbin.add(dust)

		prime_numbers.append(cand)

	return prime_numbers

